import React from "react";
import MyTypography from "../../MyTypography";

function TopBarHomeItems() {
  return headData.map((item) => {
    return (
      <MyTypography key={item.id} {...props}>
        {item.name}
      </MyTypography>
    );
  });
}

export default TopBarHomeItems;
